I am tring to use onnxruntime to run inference on model  [bidaf-9.onnx](https://github.com/onnx/models/blob/master/text/machine_comprehension/bidirectional_attention_flow/model/bidaf-9.onnx) which has input of type string[c, 1, 1, 16], I don't know how to prepare the input for that.
```
OrtStatus *retStatus;
int64_t shape[4] = {10, 1, 1, 16};
OrtValue* input_tensor;
retStatus = g_ort->CreateTensorAsOrtValue(allocator, shape, 4, ONNX_TENSOR_ELEMENT_DATA_TYPE_STRING, &input_tensor);
if (check_ortstatus(retStatus, g_ort) || !input_tensor) {
    printf("\n CreateTensorWithDataAsOrtValue() failed\n\n");
    return;
}

const char context_char[10][16] = {
        "A",
        "quick",
        "fox",
        "jumps",
        "over",
        "the",
        "lazy",
        "dog",
        "."
};
retStatus = g_ort->FillStringTensor(input_tensor, (const char * const*)context_char, 10);
if (check_ortstatus(retStatus, g_ort)) {
	printf("\n FillStringTensor() failed\n\n");
	return;
}
```

The above code gave me `input array doesn't equal tensor size`.

`const char context_char[10][1][1][1][16] = {0};` gave me the same error. 

I read the FillStringTensor() carefuly, which says `s An array of strings.` for the second parameter, does this mean that it only supports 2D strings?

**Describe the bug**
Despite what is stated in [#8903](https://github.com/microsoft/onnxruntime/pull/8903) the PDBs are still include in the NuGet and are required to run the application.

If you run and application that uses Microsoft.ML.OnnxRuntime 1.10 and you deploy it without the PDB files you get
```
Error:
  An assembly specified in the application dependencies manifest (<application-name>.deps.json) was not found:
    package: 'Microsoft.ML.OnnxRuntime', version: '1.10.0'
    path: 'runtimes/win-x64/native/onnxruntime.pdb'
```
