**Expected behavior**
The PDB files are not include in the NuGet package, nor required by applications using the package.

**Describe the bug**

Empty texture on output after GPU-GPU inference using DirectX 11 textures (single-channel) which are wrapped in `VideoFrame` for input/output binding. I am making the assumption this is a supported use-case.

**System information**
- ONNX Runtime installed from: binary (NuGet)
- ONNX Runtime version: v1.10.0
- Visual Studio version: 2019
- GPU model and memory: Nvidia RTX 2070,  8 GB

**To Reproduce**
Please see the example code below.

**Expected behavior**
Getting a valid texture instead of a zero-filled one from the output `VideoFrame` representing the inference result.

Additional notes:
- input/output textures are on the same device which is used to do the inference, there shouldn't be any sharing issues
- a copy of the output texture with the required binding flags is used as a shader resource further in the pipeline

Sanity tests:
- passing the input `VideoFrame`'s surface as a texture down the pipeline works, the input is not empty
- using a CPU `LearningModelDevice` and just creating the input/output `VideoFrame` on the source Direct3D device also works, at least with a simple test model

**Additional context**
Example code:

```
// source D3D11 device and a texture created on it
ID3D11Device *sourceDevice;
ID3D11Texture2D *sourceTexture;

// get the Direct3D11 device
com_ptr<IDXGIDevice> dxgiDevice;
sourceDevice->QueryInterface(IID_PPV_ARGS(&dxgiDevice));

com_ptr<IInspectable> inspectableDevice;
CreateDirect3D11DeviceFromDXGIDevice(dxgiDevice.get(), inspectableDevice.put());

// initialize the session using the source Direct3D11 device
LearningModel model = LearningModel::LoadFromFilePath(L"model.onnx");
LearningModelDevice device = LearningModelDevice::CreateFromDirect3D11Device(inspectableDevice.as<IDirect3DDevice>());
LearningModelSession session = LearningModelSession(model, device);
LearningModelBinding binding = LearningModelBinding(session);

// create the input/output video frames on the same Direct3D11 device
VideoFrame inputFrame = VideoFrame::CreateAsDirect3D11SurfaceBacked(
    DirectXPixelFormat::R8UIntNormalized, ONNX_INPUT_W, ONNX_INPUT_H, session.Device().Direct3D11Device());
VideoFrame outputFrame = VideoFrame::CreateAsDirect3D11SurfaceBacked(
    DirectXPixelFormat::R8UIntNormalized, ONNX_OUTPUT_W, ONNX_OUTPUT_H, session.Device().Direct3D11Device());

// create the source video frame from the source D3D11 texture
com_ptr<IDXGISurface> dxgiSurface;
sourceTexture->QueryInterface(IID_PPV_ARGS(&dxgiSurface));

com_ptr<::IInspectable> inspectableSurface;
CreateDirect3D11SurfaceFromDXGISurface(
    dxgiSurface.get(),
    reinterpret_cast<IInspectable**>(winrt::put_abi(inspectableSurface))
);

VideoFrame sourceFrame = VideoFrame::CreateWithDirect3D11Surface(inspectableSurface.as<IDirect3DSurface>());

// copy the source frame to the input frame
sourceFrame.CopyToAsync(inputFrame).get();

// create the input/output tensors
ImageFeatureValue inputTensor = ImageFeatureValue::CreateFromVideoFrame(inputFrame);
ImageFeatureValue outputTensor = ImageFeatureValue::CreateFromVideoFrame(outputFrame);

// bind and evaluate
binding.Bind(model.InputFeatures().First().Current().Name(), inputTensor);
binding.Bind(model.OutputFeatures().First().Current().Name(), outputTensor);
session.Evaluate(binding, L"");

// get the output D3D11 texture from the output tensor
auto spDxgiInterfaceAccess = outputTensor.VideoFrame().Direct3DSurface().as<IDirect3DDxgiInterfaceAccess>();
com_ptr<ID3D11Texture2D> outputTexture;
spDxgiInterfaceAccess->GetInterface(IID_PPV_ARGS(&outputTexture));

// make a copy of the output texture with D3D11_BIND_SHADER_RESOURCE and pass it down the pipeline
// ...
```

Maybe there is a sort of DirectX synchronization issue?
Is there a better alternative approach for doing GPU-GPU inference on DirectX texture data?

Thank you.

I am preparing a patch to optimize QGEMM for POWER10 hardware and I have a question about the packed kernel.

As per the following structure, there are two kernels to handle non-packed dataB and packed dataB.

struct MLAS_GEMM_QUANT_DISPATCH {
    MLAS_GEMM_QUANT_OPERATION* Operation;
    MLAS_GEMM_QUANT_OPERATION* PackedOperation;
    MLAS_GEMM_QUANT_COPY_PACKB_ROUTINE* CopyPackBRoutine;
    size_t PackedK;
    size_t PackedStrideK;
};

1. I see a note that “MlasGemmQuantOperation and MlasGemmQuantPackedOperation are shared kernel drivers” and the main difference is packed kernel does not explicitly call copypackB routine as dataB is prepacked. 
When dataB is prepacked, what is the packing routine used for it? Is it the default generic packB routine? 
2. For getting into POWER10 specific QGEMM  unless dataB is packed using  POWER10CopyPackBRoutine, I cannot reuse the P10 kernel for PackedOperation. So if I specify POWER10CopyPackBRoutine as the third element in the above structure,
Can I expect dataB to be packed using POWER10CopyPackBRoutine before getting to the POWER10 kernel in case of PackedOperation?
3. On some architecture-specific qgemm* files , PackedOperation is specified as nullptr .  When PackedOperation is nullptr, does it take the default kernel for PackedOperation?
